import {useEffect} from "react";
import logo from './logo.svg';
import './App.css';

function App() {

  useEffect(() => {
    fetch("/api")
        .then((res) => res.json())
        .then((data) => console.log(data));
  }, []);

  return (
    <div className="App">
      <div className="login-wrapper">
        <h1>Please Log In</h1>
        <form>
          <label>
            <p>Username</p>
            <input type="text" />
          </label>
          <label>
            <p>Password</p>
            <input type="password" />
          </label>
          <div>
            <button type="submit">Submit</button>
          </div>
        </form>
      </div>
    </div>
  );
}

export default App;
